Diagnosis. A very distinctive species, recognized by the black shining dorsum with faint metallic reflections, the deeply striate­impressed elytral series, the comparatively wide elytral intervals, the distinctive subdeltoid pronotal shape (
Fig. 1
), and the entirely hydrofuge pubescent metasternum.

Aedeagus: Length 0.35 mm .; mainpiece slightly sinuate, apex slightly asymmetrical, wedge­shaped; distal part of internal tube oval in ventral aspect; parameres with distal pair of setae relatively short (
Fig. 15
).

Distribution. Currently known from southern Victoria (
Fig. 21
).
